import React, { useEffect, useState } from 'react';

const FileList = () => {
  const [files, setFiles] = useState([]);

  const loadFileList = () => {
    // Make a GET request to retrieve the file list
    // Replace 'your-file-list-api-url' with the actual endpoint
    fetch('your-file-list-api-url')
      .then((response) => response.json())
      .then((data) => {
        setFiles(data);
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  };

  useEffect(() => {
    loadFileList();
  }, []); // Load the file list on component mount

  const updateFile = (fileName) => {
    // Make a PUT request to update the file using the fileName
    // Replace 'your-update-api-url' with the actual endpoint
    fetch(`your-update-api-url/${fileName}`, {
      method: 'PUT',
    })
      .then((response) => response.text())
      .then((data) => {
        alert(data);
        loadFileList(); // Reload the file list after updating
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  };

  const deleteFile = (fileName) => {
    // Make a DELETE request to delete the file using the fileName
    // Replace 'your-delete-api-url' with the actual endpoint
    fetch(`your-delete-api-url/${fileName}`, {
      method: 'DELETE',
    })
      .then((response) => response.text())
      .then((data) => {
        alert(data);
        loadFileList(); // Reload the file list after deleting
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  };

  return (
    <div>
      <h2>File List</h2>
      <table>
        <thead>
          <tr>
            <th>File Name</th>
            <th>Update</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {files.map((file) => (
            <tr key={file.fileName}>
              <td>{file.fileName}</td>
              <td>
                <button onClick={() => updateFile(file.fileName)}>Update</button>
              </td>
              <td>
                <button onClick={() => deleteFile(file.fileName)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default FileList;
